    [],nt"revision_timestamp": "2016-01-16T06:27:41.247571",nt"name": "2014-u-s-geological-survey-cmgp-lidar-post-sandy-national-capital-region",nt"isopen":
    false,nt"url": null,nt"notes": "USGS Contract No. G10PC00025 CONTRACTOR:
    Quantum Spatial, Inc Ground Control Points were acquired and calibrated by Compass
    Data, Inc. All Lidar data acquisition, calibration, and follow-on processing were
    completed by the prime contractor. Geographic Extent: SANDY_Restoration_VA_MD_DC_QL2
    Area of Interest covers approximately 2,002 square miles. Lot #5 contains the full
    project area Dataset Description: The SANDY_Restoration_VA_MD_DC_QL2 project called
    for the Planning, Acquisition, processing and derivative products of LIDAR data
    to be collected at a nominal pulse spacing (NPS) of 0.7 meter. Project specifications
    are based on the U.S. Geological Survey National Geospatial Program Base LIDAR Specification,
    Version 1. The data was developed based on a horizontal projection/datum of UTM
    Zone 18 North, NAD83, meters and vertical datum of NAVD1988 (GEOID12A), meters.
    LiDAR data was delivered in RAW flight line swath format, processed to create Classified
    LAS 1.2 Files formatted to 2283 individual 1500m x 1500m tiles, and corresponding
    Intensity Images and Bare Earth DEMs tiled to the same 1500m x 1500m schema, and
    Breaklines in ESRI Shapefile format. Ground Conditions: LiDAR was collected in Winter
    2014, while no snow was on the ground and rivers were at or below normal levels.
    In order to post process the LiDAR data to meet task order specifications, Quantum
    Spatial established a total of 59 QA control points and 95 Land Cover control points
    that were used to calibrate the LIDAR to known ground locations established throughout
    the SANDY_Restoration_VA_MD_DC_QL2 project area. NOAA OCM processed the data under
    the mission name National Capital Region rather than Lot #5.",nt"license_title":
